}

.pricing-table {
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
}

.pricing-table h2 {
    margin: 60px;
    font-weight: 700;
    font-size: 2.5rem;
}

.container {
    display: flex;
    justify-content: space-between;
    align-items: center;
    width: 70%;
    margin: 20px 0;
}

.element {
    width: 50% !important;
}

.pricing-table .element {
    // border: 1px solid var(--dark-grey);
    border-radius: 12px;
    height: 100%;
    width: 100%;
    margin: 20px;
    display: flex;
    flex-direction: column;
    overflow: hidden;
    justify-content: space-around;
    align-items: center;
    font-size: 1.1rem;
    background-color: #ffffff !important;
    border: 1px solid #e8e8e8;
