}

.element .info h3 {
    font-size: 1.8rem;
    margin: 10px;
    text-align: center;
}

.element .info p {
    text-align: center;
    margin: 0 20px;
    font-size: 1.2rem;
}

.element .price {
    font-size: 4rem;
    font-weight: 700;
}

.element .period {
    display: flex;
    flex-direction: row;
    justify-content: space-around;
    background-color: var(--grey);
    padding: 0.5rem;
    border-radius: 8px;
    color: var(--dark);
}

.element .period label {
    flex: 1 1 50%;
    text-align: center;
    padding: 0.5rem 2rem;
    cursor: pointer;
}

.element .period label:hover {
    text-decoration: underline;
}


label {
    padding: 20px;
}

.period input[type="radio"] {
    display: none;
}

.period {
    border: 2px solid #ebebeb;
    border-radius: 30px;
}

.period input[type="radio"]:checked+label {
    font-weight: 700;
    font-weight: 700;
    background-color: #2500f9;
    border-radius: 30px;
    color: #fff;
}

.element ul {
    font-size: 1.2rem;
    list-style-type: none;
}

.element ul li {
    margin: 10px;
    padding: 10px 0;

}

.element ul li::before {
    content: url("https://karolnowinski.pl/assets/check-mark.svg");
    display: none;
    margin: 0 10px;
    width: 1em;
    height: auto;
}


.active {
    background: linear-gradient(135deg, var(--red), var(--orange));
    // color: var(--white);
    // border: 1px solid transparent !important;
}

.active ul li::before {
    content: url("https://karolnowinski.pl/assets/check-mark-white.svg");
}

.active button {
    border-color: transparent;
}

